import { Route } from "react-router-dom";
import "./App.css";
import { Swap } from "./components";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <div>
        <Routes>
          <Route path="/" element={<Swap />}></Route>
        </Routes>
      </div>
    </div>
  );
}

export default App;
